import React from 'react';
import Avatar from './components/Avatar';

const App: React.FC = () => {
  const avatarInfo = {
    imageUrl: 'https://res.cloudinary.com/dcba9lt2s/image/upload/v1703084597/lhmbfdfc1qqlc7tlstdt.jpg',
    altText: 'Gregorio Y. Zara',
    className: 'avatar',
    imageSize: '500px',
    imageStyles: {
      margin: '20px', 
    },
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '200vh' }}>
      <div>
        <h1>Avatar!</h1>
        <Avatar avatarInfo={avatarInfo} />
      </div>
    </div>
  );
};

export default App;
